answer: PLANES
answer-analysis: '首先通过浏览器开发者工具可以查看格子代码，会看到每个格子的背景色是用 HSL 格式写的。


  其中亮度（L）要么 10%，要么 95%，就是为了画出题目中的鱼，所以可知应该没有多余的信息了。


  色相（H）分布比较均匀，几乎 0-360 都有，所以暂时也看不出什么。


  剩下中间的饱和度（S）的分布比较特殊，最低值为 32，最高值为 86。这是 ASCII 代码，翻译成字符后可以得到一句不断重复的提示：`USE HUE AS THE
  ANGLE, PLOT 1820 POINTS ON UNIT CIRCLE, THEN CONNECT THEM IN THE GIVEN ORDER`.


  也就是说，我们要把色相的数字当成角度，按顺序在一个圆上连线。这里可以用各种工具，最终连完的结果如图：


  <img src="/ccbc13/images/CCBC-14/f92be7a466094c27acba3ffc500590f8.webp" style="width:700px">


  <p> </p>


  可以看出答案是 `PLANES`。'
