tips:
- content: 用浏览器的开发者工具查看每个格子的底色。（在部分浏览器上可以右键点击色块->检查/inspect来快速定位颜色代码的位置。）颜色是 HSL 格式，其中明度（L）是
    10% 或者 95% 用来画出黑白的图案，没有其它信息。需要用到的是另外两个，色相（H）和饱和度（S）的值。先看饱和度。
  title: 不知道从何入手
- content: 查看 ASCII 代码，将数字翻译成字符。
  title: 找到了一些全部都是两位数的数字，但是无法理解
- content: 不需要编程，根据题目里的信息，转换成 x,y 的坐标后在 Excel 或类似工具里绘制散点图连线就可以（但是线要尽可能细，图要尽可能地画得大一点）。
  title: 虽然知道要干什么，但是这好像需要我不会的专业技术？
